import React, { Component } from "react";
import { BrowserRouter as Router } from "react-router-dom";
import "./App.css";

import TransitionsModal, { AddForm } from "./components/AddForm";

class App extends Component {
  render() {
    return (
      <Router>
        <div className="App">
          <AddForm />
        </div>
      </Router>
    );
  }
}

export default App;
